var longestDupSubstring1 = function(S) {
    let holder = {}
    let starter = 0;
    let longest = '';
    let longestLength = 0;
    let stopper = 1; 
    let segment = '';
    
    for (var i = 2; i <= S.length; i++) {
        let newSlice, newSliceLength;
        while (starter < (i - stopper)) {
            newSlice = S.slice(starter, i);
            newSliceLength = newSlice.length;
            
            if (holder[newSlice]) {
                if (S.slice(starter, i).length > longestLength) {
                    longest = newSlice;
                    longestLength = longest.length;
                    stopper = longestLength - 1;
                }
            } else {
                holder[newSlice] = true;
            }
            starter++;
        }
        starter = 0;
    }
    
    return longest;
};

var longestDupSubstring2 = function(S) {
	let sLength = S.length;
	let len = sLength - 1;
	let word;
	let holder = {};

	while(len > 1) {
		for (var i = 0; i <= (sLength - len); i++) {
			word = S.slice(i, i+len);
			if (holder[word]) {
				return word;
			} else {
				holder[word] = true;
			}
		}
		len--;
	}

	return '';
}

var longestDupSubstring3 = function(S) {
  	let longest = '';
	let substringHelper = (subLength) => {
		if (subLength === 0) return; 

		let startingPoint = 0; 
		let movement = S.length - subLength; 

		let word, searchField, rex, matching;

		while (startingPoint < movement) {

			word = S.slice(startingPoint, startingPoint + subLength);
			searchField = S.slice(startingPoint + 1, S.length);
		  rex = new RegExp(word,'g');
		  matching = searchField.match(rex);

			if (matching) {
			  longest = word;
			  return longest;
			}

		  startingPoint++;
		}
		return substringHelper(subLength - 1);
	}

	return substringHelper(S.length - 1) ? longest : '';
}
longestDupSubstring1(""); //works, but is sloooow 

longestDupSubstring2(""); //works, but is sloooow 

longestDupSubstring3(""); //works, but is sloooow 